(window.webpackJsonp=window.webpackJsonp||[]).push([[1064],{1418:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1931-lai-vao-thong-than-đien"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1931-lai-vao-thong-than-đien"}},[n._v("#")]),n._v(" Chương 1931: Lại vào Thông Thần điện")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("br"),t("br"),n._v("Thấy đối phương chạy trốn, Trương Huyền mỉm cười, đứng dậy, ống tay áo nhẹ nhàng vung lên."),t("br"),t("br"),n._v("Phần phật!"),t("br"),t("br"),n._v("Đầy sân thi thể, nhất thời thiêu đốt lên, một lát sau biến thành tro tàn, theo dòng nước ngầm, chảy xuôi mà đi."),t("br"),t("br"),n._v("Trong viện phảng phất chuyện gì cũng chưa từng xảy ra đồng dạng, tất cả dấu vết đều biến mất không còn một mảnh."),t("br"),t("br"),n._v("Xoay người đi vào gian phòng, khoanh chân ngồi xuống, tiếp tục khôi phục chân khí trong cơ thể."),t("br"),t("br"),n._v("Không thể không nói, nấu hồ lô được nước, quả thực hiệu quả không tệ, lần này thân thể khôi phục, xem như triệt để thích ứng Thượng Thương không gian cùng linh khí, hấp thu lên, trở nên trôi chảy không ít."),t("br"),t("br"),n._v("Tu luyện hơn một canh giờ, ngừng lại, tinh thần câu thông đan điền: “Hồ lô, ngươi đến cùng là cái gì?”"),t("br"),t("br"),n._v("Hắn thực sự có chút hiếu kỳ."),t("br"),t("br"),n._v("Thương thế trên người nặng, có thể cảm thụ được, nấu hồ lô nước uống vào liền có thể khôi phục, cái tên này, chỉ sợ so tưởng tượng còn muốn đáng sợ."),t("br"),t("br"),n._v("Nếu không, cũng không có khả năng để Khưu Ngô Cổ Thánh, đặc biệt sắp đặt không gian trận pháp, bồi dưỡng vài vạn năm, thậm chí Khổng sư đều có lưu lại ý niệm."),t("br"),t("br"),n._v("“Nơi này có không ít ta có thể ăn, chỉ cần cho đủ ăn, liền có thể đi ra, đến lúc đó ngươi sẽ biết...”"),t("br"),t("br"),n._v("Hồ lô trong đan điền vặn vẹo một chút, lần nữa tìm cái thoải mái địa phương nằm."),t("br"),t("br"),n._v("Lại hỏi vài câu, thấy cái tên này không thấy thỏ không thả chim ưng, Trương Huyền đành phải không tiếp tục để ý, từ trong ngực lấy ra thông thần ngọc phù, chần chờ một chút, tinh thần khẽ động, lần nữa chui vào."),t("br"),t("br"),n._v("..."),t("br"),t("br"),n._v("“Làm sao còn chưa có trở lại?”"),t("br"),t("br"),n._v("Phủ thành chủ, Tiết Trầm lông mày nhăn thành cục."),t("br"),t("br"),n._v("Dựa theo tình huống bình thường, phái đi tinh binh, hẳn là đã sớm giết tên phế vật kia trở về, làm sao cái này đều hơn một canh giờ, một điểm động tĩnh đều không có?"),t("br"),t("br"),n._v("“Ngươi đi qua nhìn một chút!”"),t("br"),t("br"),n._v("Bàn giao một cái hộ vệ một tiếng."),t("br"),t("br"),n._v("Hộ vệ mặc vào y phục dạ hành, bay lượn mà ra, thời gian không dài, một mặt cổ quái trở lại trước mặt: “Bẩm báo huấn luyện viên, Thiện gia động tĩnh gì đều không có, Thiện Hiểu Thiên cùng Thiện Dịch hoàn hảo không chút tổn hại!”"),t("br"),t("br"),n._v("Tiết Trầm ngẩn ngơ: “Cái này sao có thể? Mệnh lệnh của ta chẳng lẽ không rõ?”"),t("br"),t("br"),n._v("Đặc biệt bàn giao rất lâu, dùng tốc độ nhanh nhất giết ba người kia, kết quả, đối phương chuyện gì đều không có... Xảy ra chuyện gì?"),t("br"),t("br"),n._v("“Đi thăm dò một chút, nhìn một chút đám người này đến cùng đi nơi nào!”"),t("br"),t("br"),n._v("Khí sắp bùng nổ, quát lớn."),t("br"),t("br"),n._v("Hộ vệ lần nữa rời đi, một lát sau nguồn gốc đến trước mặt: “Căn cứ dấu chân cùng dấu vết, bọn họ tất cả đều đi vào Thiện gia, có điều, lại không có rời đi... Suy đoán không tệ... Khả năng đều bị giết, hơn nữa hủy thi diệt tích!”"),t("br"),t("br"),n._v("“Bị giết? Chỉ bằng ba người kia?”"),t("br"),t("br"),n._v("Tiết Trầm sửng sốt."),t("br"),t("br"),n._v("Hơn năm mươi vị tinh binh, mỗi một cái đều có Đại Thánh nhất trọng thực lực, cầm đầu đội trưởng càng là nhị trọng, liên hợp cùng một chỗ, Đại Thánh tam trọng, thậm chí tứ trọng đều có thể một trận chiến, một đi không trở lại, một điểm động tĩnh đều không có phát ra..."),t("br"),t("br"),n._v("Thiện Hiểu Thiên cùng cái kia đường đều đi không được thương binh, thật có thực lực mạnh như vậy?"),t("br"),t("br"),n._v("“Chẳng lẽ... Hắn nói là sự thật?”"),t("br"),t("br"),n._v("Đột nhiên nhớ tới sơn tặc Tào Thành Lập."),t("br"),t("br"),n._v("Thiện Hiểu Thiên trong nhà có một thớt rất lợi hại ngựa, còn giống như có một cái biết võ kỹ xe!"),t("br"),t("br"),n._v("Chẳng lẽ, cái đồ chơi này thật tồn tại?"),t("br"),t("br"),n._v("“Huấn luyện viên, chúng ta bây giờ làm sao bây giờ? Có muốn hay không tiếp tục phái người tới?”"),t("br"),t("br"),n._v("Gặp hắn suy nghĩ, hộ vệ nhìn qua."),t("br"),t("br"),n._v("“Trước không cần... Nếu thật là bọn họ giết chết, đã có đề phòng, có thể giết nhiều người như vậy, không ngại giết chết càng nhiều!”"),t("br"),t("br"),n._v("Lắc đầu, đem trong đầu lung ta lung tung suy nghĩ dứt bỏ, Tiết Trầm lông mày nhăn lại: “Hơn nữa, trời đã nhanh sáng rồi, một đạo gây ra động tĩnh, đối phủ thành chủ danh tiếng sẽ có rất lớn tổn thương!”"),t("br"),t("br"),n._v("“Cái này... Chẳng lẽ chết nhiều huynh đệ như vậy, cứ tính như thế?”"),t("br"),t("br"),n._v("Hộ vệ vội vàng nhìn tới."),t("br"),t("br"),n._v("Tuy là phủ thành chủ tài đại khí thô, có thể năm mươi cái hộ vệ, cũng là hao tốn không biết bao nhiêu tâm huyết bồi dưỡng ra tới, liền như thế bị giết sạch, bọt khí đều không bốc lên một cái, đổi lại ai, đều không tiếp thụ được."),t("br"),t("br"),n._v("Tiết Trầm mắt sáng lên: “Ngươi đi một chuyến Hồng Nhạn thương hội, trên đường cẩn thận tìm kiếm mỗi một cái có thể mai phục người đường tắt, nhìn một chút có thể hay không tìm tới, sơn tặc tung tích hoặc là thi thể, đánh nhau dấu vết cũng có thể!”"),t("br"),t("br"),n._v("“Được!” Hộ vệ lần nữa đi ra ngoài, lần nữa không tiêu tốn bao lâu, về đến phòng: “Bẩm báo huấn luyện viên, kể giáp ngõ hẻm, quả thực phát hiện một chút thi thể, cùng thất lạc cung tên binh khí, chính là những cái kia chết đi sơn tặc.”"),t("br"),t("br"),n._v("“Ừm, phái người đem những sơn tặc này thi thể, triệt để hủy diệt, sau đó đem binh khí, cùng một chút hộ vệ khôi giáp, nhiễm phải máu, đưa đến Thiện gia lân cận địa phương, lặng lẽ chôn xuống!”"),t("br"),t("br"),n._v("Hừ lạnh một tiếng, Tiết Trầm khóe miệng nâng lên."),t("br"),t("br"),n._v("“Chôn vũ khí?”"),t("br"),t("br"),n._v("Gặp hắn không hiểu, Tiết Trầm trong mắt ánh sáng lóe lên: “Thiện Hiểu Thiên từ trước tới nay phế vật, Thiện Dịch thực lực, lại mọi người đều biết, nếu như tra ra, phủ thành chủ có rất nhiều binh sĩ, mất đi tung tích, mà bọn họ phủ đệ xung quanh, lại tìm ra sơn tặc vũ khí cùng hộ vệ mang máu khôi giáp, ngươi cho rằng sẽ có kết quả như thế nào?”"),t("br"),t("br"),n._v("“Cái này... Hắn thông đồng sơn tặc, giết chết phủ thành chủ hộ vệ...” Hộ vệ mắt sáng rực lên."),t("br"),t("br"),n._v("Thật muốn làm như vậy, vị này Thiện Hiểu Thiên, không cần giết, cũng sẽ quán Thượng Quan tư, thân bại danh liệt là khẽ, làm không cẩn thận, sẽ còn bởi vậy bị chém đầu răn chúng."),t("br"),t("br"),n._v("Sơn tặc gieo họa bách tính, đã sớm được người căm thù đến tận xương tuỷ, nếu như biết hắn tới có thông đồng, nhất định gặp phải phỉ nhổ."),t("br"),t("br"),n._v("Từ hôn, cũng liền trở nên đương nhiên."),t("br"),t("br"),n._v("Phủ thành chủ loại này cao thượng chi địa, làm sao có thể bị tuyên bố hỗn loạn người bôi nhọ?"),t("br"),t("br"),n._v("“Không sai, sáng mai, lập tức thả ra tiếng gió, liền nói phủ thành chủ có năm mươi người hộ vệ, phát hiện sơn tặc tung tích, đi vào đuổi bắt, kết quả mất đi tung tích, cần toàn thành tìm kiếm... Chuyện này, huyên náo động tĩnh càng lớn càng tốt, người tốt nhất người đều biết!”"),t("br"),t("br"),n._v("Tiết Trầm cười cười: “Chờ dư luận lên men gần như, làm theo thông lệ, đi Thiện gia tìm kiếm, tìm tới vũ khí cùng mang máu khôi giáp... Còn lại liền dễ làm!”"),t("br"),t("br"),n._v("“Vâng!”"),t("br"),t("br"),n._v("Nghe được huấn luyện viên, căn cứ bất lợi tình huống lập tức thiết kế ra như vậy tinh diệu bố cục, hộ vệ phục sát đất, đồng thời nhịn không được nói: “Nếu như, hắn không thừa nhận đâu?”"),t("br"),t("br"),n._v("Tiết Trầm ánh mắt run lên: “Không phải do hắn không thừa nhận, chỉ cần lục soát đi ra, không thừa nhận cũng vô dụng! Vào phủ thành chủ, chữ quan hai cái miệng, muốn cho hắn có tội tình gì tên, còn không phải chuyện dễ như trở bàn tay?”"),t("br"),n._v("“Cũng phải...”"),t("br"),t("br"),n._v("Hộ vệ gật gật đầu: “Thuộc hạ vậy thì đi làm!”"),t("br"),t("br"),n._v("..."),t("br"),t("br"),n._v("“Nhị tiểu thư, ngươi tìm ta?”"),t("br"),t("br"),n._v("Tiết Trầm bên này an bài hãm hại Thiện Hiểu Thiên, Tiết Cầm thì trở lại khuê phòng của mình, rất lâu không cách nào chìm vào giấc ngủ, qua không biết bao lâu, đem chăm sóc Lăng Vân kiếm các đệ tử Hoắc Giang Hà một thanh niên tìm tới."),t("br"),t("br"),n._v("Người thanh niên này, cũng là Lăng Vân kiếm các người, giống như nàng, đều là tạp dịch đệ tử, tương đương với thiếp thân tôi tớ, chịu trách nhiệm ngoại môn đệ tử sinh hoạt thường ngày cùng sinh hoạt, miễn cho bị thế tục quấy nhiễu, không thể chuyên tâm tu luyện."),t("br"),t("br"),n._v("“Chút tiền ấy, là ta một chút tâm ý, mong rằng sư huynh vui lòng nhận!”"),t("br"),t("br"),n._v("Khoát tay chặn lại, một cái nha hoàn đưa tới một cái túi kim tệ, lung lay, rầm vang vọng, chừng hơn một trăm viên."),t("br"),t("br"),n._v("“Tất cả mọi người là sư huynh muội, nhị tiểu thư khách khí...” Thanh niên ánh mắt sáng lên, đem cái túi cầm tại lòng bàn tay."),t("br"),t("br"),n._v("Hắn loại này tạp dịch đệ tử, bình thường là không có gì chất béo, một chút cho nhiều như vậy, lập tức mừng rỡ như điên."),t("br"),t("br"),n._v("“Hoắc sư huynh, tối nay trở về, nhưng có nói cái gì?”"),t("br"),t("br"),n._v("Tiết Cầm nhìn qua."),t("br"),t("br"),n._v("“Sư huynh không nói gì...” Thanh niên giờ mới hiểu được mục đích của đối phương, sửng sốt một chút, nghĩ tới cái gì nói: “Đúng rồi, hắn nói... Thông Thần điện cái kia gọi thiên nhai người, vừa xuất hiện liền báo tin hắn!”"),t("br"),t("br"),n._v("“Thiên Nhai?”"),t("br"),t("br"),n._v("Tiết Cầm nghi ngờ."),t("br"),t("br"),n._v("“Là như vậy...” Thanh niên biết chuyện từ đầu đến cuối, rất nhanh nói một lần."),t("br"),t("br"),n._v("“Thì ra là thế... Nếu như vị này Thiên Nhai xuất hiện, hi vọng còn làm phiền phiền, sư huynh sớm cùng ta nói một tiếng, ta tự mình đi báo tin Hoắc sư huynh!” Tiết Cầm vẫy tay một cái lại đưa tới một cái túi kim tệ."),t("br"),t("br"),n._v("“Cái này dễ nói!”"),t("br"),t("br"),n._v("Con mắt sáng lên, thanh niên liên tục gật đầu."),t("br"),t("br"),n._v("Chuyện này đối với hắn tới nói, không tính là gì, có thể có được chỗ tốt, sao lại không làm?"),t("br"),t("br"),n._v("Lời còn chưa dứt, đột nhiên thanh niên cúi đầu, từ trong ngực lấy ra một cái ngọc phù, liếc mắt nhìn, mắt sáng rực lên: “Nhị tiểu thư quả nhiên vận khí tốt, vị kia Thiên Nhai đi vào Thông Thần điện, cùng đi với ta tìm sư huynh đi!”"),t("br"),t("br"),n._v("“Được!”"),t("br"),t("br"),n._v("Tiết Cầm vội vàng đứng dậy, theo sát tại thanh niên sau lưng, hướng Hoắc Giang Hà vị trí sân nhỏ đi tới."),t("br"),t("br"),n._v("Thời gian không dài đi tới trước mặt."),t("br"),t("br"),n._v("“Đi lên?”"),t("br"),t("br"),n._v("Nghe được hai người tới báo, Hoắc Giang Hà ánh mắt híp lại."),t("br"),t("br"),n._v("“Sư huynh, đây là Tinh Diệu thành Thông Thần điện thông thần ngọc phù...”"),t("br"),t("br"),n._v("Tiết Cầm vội vàng lấy ra hai cái ngọc phù đưa tới."),t("br"),t("br"),n._v("Ngọc phù cứ việc rất trân quý, nhưng đối với phủ thành chủ tới nói, không tính là gì."),t("br"),t("br"),n._v("“Ừm!” Thấy nữ hài như vậy thức thời, Hoắc Giang Hà đứng lên nói: “Cùng ta đi vào chung a, vừa vặn cũng để cho ngươi mở mang kiến thức một chút, ta Lăng Vân kiếm các, chân chính kiếm thuật!”"),t("br"),t("br"),n._v("“Đa tạ sư huynh!”"),t("br"),t("br"),n._v("Thấy đối phương không có trách tội ý tứ, Tiết Cầm lúc này mới thở phào nhẹ nhõm, câu thông ngọc phù."),t("br"),t("br"),n._v("Ông! Ông!"),t("br"),t("br"),n._v("Hai người đồng thời tiến vào bên trong."),t("br"),t("br"),n._v("..."),t("br"),t("br"),n._v("“Vẫn là không tiện, nhìn có thể hay không mua một cái không gian giới chỉ!”"),t("br"),t("br"),n._v("Tại danh sư đại lục dùng đã quen không gian giới chỉ, nơi này không có cái gì, chứa đồ vật thực sự quá phiền toái, cho nên, Trương Huyền lần này đi vào, chính là muốn hỏi một chút, nơi này có thể hay không mua được, giá cả lại là bao nhiêu."),t("br"),t("br"),n._v("Tuy là bên ngoài là nửa đêm, nhưng Thông Thần điện vẫn như cũ kín người hết chỗ, hơn nữa, nơi này là không có đêm tối, rất mau tới đến trước đài, đem mục đích của mình hỏi lên."),t("br"),t("br"),n._v("“Trữ vật giới chỉ, có thể mua được, một cái năm mươi vạn thông thần tệ!”"),t("br"),t("br"),n._v("Phục vụ viên nói."),t("br"),t("br"),n._v("“Năm mươi vạn?” Trương Huyền lông mày nhảy dựng."),t("br"),t("br"),n._v("Thật là đắt!"),t("br"),t("br"),n._v("Khó trách Thiện gia đại gia tộc như thế, đều không có một cái."),t("br"),t("br"),n._v("“Ta trước đó liên tục khiêu chiến tám tràng chiến thắng, hiện tại khiêu chiến, là theo trận đầu tính, vẫn là trận thứ chín tính?”"),t("br"),t("br"),n._v("Dừng lại một chút, nhìn qua."),t("br"),t("br"),n._v("Công khai thi đấu đối với hắn mà nói, là hiện nay kiếm tiền phương pháp nhanh nhất, chỉ bất quá... Hắn nửa đường rời đi, nếu như dựa theo trận đầu tính, thu vào rất nhỏ yếu!"),t("br"),t("br"),n._v("Dựa theo trận thứ tám mà nói, đoán chừng lại không người tới..."),t("br"),t("br"),n._v("Tinh Diệu thành cứ như vậy lớn, cao thủ cứ như vậy nhiều, bản thân liên tục khiêu chiến cái này nhiều người, không ít người đã không nguyện ý dùng tiền cố ý tìm thua."),t("br"),t("br"),n._v("“Ngươi liên tục chiến thắng tám tràng, tham gia sơ cấp tranh tài, khả năng muốn cùng ngươi khiêu chiến đã không nhiều lắm, còn trung cấp tỷ thí, ngày hôm nay cũng không có buổi diễn, sớm nhất cũng phải ngày mốt, lại nói, đẳng cấp của ngươi cũng không quá đủ!”"),t("br"),t("br"),n._v("Phục vụ viên nhìn một chút, nói."),t("br"),t("br"),n._v("“Trung cấp tỷ thí?”"),t("br"),t("br"),n._v("Trương Huyền nghi ngờ."),t("br"),t("br"),n._v("Sơ cấp, trung cấp, chuyện gì xảy ra?"),t("br"),t("br"),n._v("Chẳng lẽ công khai thi đấu, còn muốn phân đẳng cấp cấp?"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1943"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1945"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);